import React from "react";
import Grid from '@material-ui/core/Grid';
import homeWhite from "../../../img/icons/home-white.png";
import searchWhite from "../../../img/icons/search-black.png";
import './Header.css'
import logo from "../../../img/icons/name-white.png";


export default class MenuIcons extends React.Component {
     constructor() {
        super();
        this.state = {
            notifications: 4,
        };
    }

    render () {
        <div className={'MenuIcons'}>
            <Grid item xs={1}>
                <img className={'menuItem'} src={homeWhite} alt="Logo" />
            </Grid>
        </div>
    }
}
